function kemm(kaset){
var adkas = '';
switch (kaset) {
 case 'C':adkas = 'CH'; break;
 case 'Ç':adkas = "C'H"; break;
 case 'Ù':adkas = 'OÙ'; break;
 default :adkas = kaset;
 }
return adkas;
}

